s = ""
# s = "sebaerbs"

# automatic
def occurence_left_to_right(s):
    """
    this dict fromkeys can find the non duplicate characters
    the occurence chars are from left to right
    """

    return list(dict.fromkeys(s))


# manual
def iterate_left_to_right(s):
    unique_chars = set(s) # get unique chars but the position are random
    
    target = []
    for char in s:
        if char in unique_chars:
            target.append(char)
            unique_chars.remove(char)

    return target


target1 = "".join(iterate_left_to_right(s)) 
target2 = "".join(occurence_left_to_right(s)) 

print(target1, target2)